//
// Convert an upper-case letter to the corresponding lower-case letter.
//
UINT_32 CharTable::Lowercase(const UINT_32 iChar)
{
	// Number of elements
	INT_32        iLBound = 0;
	INT_32        iRBound = sizeof(mUCSU2L) / sizeof(UCSTransMap) - 1;
	UINT_32       iUC;
	INT_32        iPos;

	// Binary search
	for(;;)
	{
		// Calculate new position
		iPos = (iRBound + iLBound) >> 1;
		iUC = mUCSU2L[iPos].sc;

		// Search in left half
		if      (iUC > iChar) { iRBound = iPos; }
		// Search in right half
		else if (iUC < iChar) { iLBound = iPos; }
		// Found symbol
		else                  { return mUCSU2L[iPos].dc; }

		// Nothing found
		if (iRBound - iLBound <= 1)
		{
			if (iChar == mUCSU2L[iRBound].sc) { return mUCSU2L[iRBound].dc; }
			if (iChar == mUCSU2L[iLBound].sc) { return mUCSU2L[iLBound].dc; }

			return iChar;
		}
	}
// Make compiler happy
return 0;
}

